                                    const new_edge = Object.assign({}, node_type.edges[i]);
                                    new_edge.from =  `${node.id}/${new_edge.from}`;
                                    new_edge.to =  `${node.id}/${new_edge.to}`;
                                    graph.edges.push(new_edge);
